import Axios from "axios";

const host = "http://127.0.0.1:4567"

const get = async (link) => {
    return await Axios.get(`${host}${link}`)
}

const post = async (link, data) => {
    return await Axios.post(`${host}${link}`, data)
}

export {get, post};
